import { connect } from 'react-redux'
import { } from '../../../redux/actions/users.js'
import { Container, Segment, Header, Image, Divider } from 'semantic-ui-react'

class Deposit extends Component {

  render() {
    return(
      <Container>
      <Segment>
        <Header as='h3'>Section One</Header>
        <Image src='/images/wireframe/short-paragraph.png' />

      <Divider section />

        <Header as='h3'>Section Two</Header>
        <Image src='/images/wireframe/short-paragraph.png' />
      </Segment>
      </Container>
    )
  }
}

export default connect(null, { })(Deposit);
